        pivot = arr[high]
        i = low
        for j in range(low, high):
            if arr[j] <= pivot:
                arr[i], arr[j] = arr[j], arr[i]
                i += 1
        arr[i], arr[high] = arr[high], arr[i]
        return i

    low = 0
    high = n - 1
    while low <= high:
        pivot = partition(arr, low, high)
        if k == pivot + 1:
            return arr[pivot]
        elif k < pivot + 1:
            high = pivot - 1
        else:
            low = pivot + 1

    return None
